  constructor() {
    this.initializeFonts();
  }

  /**
   * Initializes fonts using the globally loaded VFS (from assets/fonts/vfs_fonts.js).
   */
  private initializeFonts(): void {
    // If vfs_fonts.js was included correctly, it should have assigned to window.pdfMake.vfs
    if (typeof window !== 'undefined' && (window as any).pdfMake?.vfs) {
      (pdfMake as any).vfs = (window as any).pdfMake.vfs;
      (pdfMake as any).fonts = FONT_DEFINITIONS;

      console.log(pdfMake, 'pdfMake');

      console.log('[pdfMake] Custom fonts initialized from vfs_fonts.js');
    } else {
      console.error('[pdfMake] Failed to initialize fonts. vfs_fonts.js not loaded?');
    }
  }


